import React , { useEffect, useReducer, useState }from "react";
import "./Login.css" ;
import {useNavigate} from 'react-router-dom';

function Login() {
    const[id , setid]=useState();

    const Studenthandle =(e)=>{
        e.preventdefault();
        useNavigate('/Studentmain', {replace:true});
    }

    return ( 
    <div className="Login">
    <h1>LOGIN</h1>
    <div className="det">
    <span class="details"> ID<br/>
    <input type='text' name="id"/></span>
    <span class="details"> password <br/>
    <input type='password' name="password" /></span>
    
    </div>
    <div className="button-set">
    <button type="button" onClick={Studenthandle}>STUDENT</button>
    <button type="button">TEACHER</button>
    <button type="button">ADMIN</button>
    </div>
    </div>

    );
};
export default Login;
